/* eslint-disable react/prop-types */
// @mui material components
import Icon from "@mui/material/Icon";
import IconButton from "@mui/material/IconButton";
import MapIcon from "@mui/icons-material/Map";

// Argon Dashboard 2 MUI components
import ArgonBox from "components/ArgonBox";
import ArgonTypography from "components/ArgonTypography";
import ArgonBadge from "components/ArgonBadge";

function LicenseStatus({ status }) {
  return (
    <ArgonBadge
      variant="gradient"
      badgeContent={status}
      color={status === "renewed" ? "success" : "error"}
      size="xs"
      container
    />
  );
}

const action = (
  <Icon sx={{ cursor: "pointer", fontWeight: "bold" }} fontSize="small">
    more_vert
  </Icon>
);

const handleMapClick = (hotelName) => {
  // Function to handle map icon click
  console.log(`Displaying location for ${hotelName}`);
  // Add your logic here to display the location
};

const hotelsTableData = {
  columns: [
    { name: "hotel", align: "left" },
    { name: "location", align: "left" },
    { name: "capacity", align: "center" },
    { name: "license status", align: "center" },
    { name: "action", align: "center" },
    { name: "map", align: "center" },
  ],

  rows: [
    {
      hotel: [
        <ArgonBox display="flex" alignItems="center" key="HH">
          <ArgonTypography variant="button" fontWeight="bold">
            HH
          </ArgonTypography>
          <IconButton onClick={() => handleMapClick("Hill Station Hotel")} size="small">
            <MapIcon fontSize="small" />
          </IconButton>
        </ArgonBox>,
        "Hill Station Hotel"
      ],
      location: (
        <ArgonTypography variant="button" color="text" fontWeight="medium">
          Jos, Plateau State
        </ArgonTypography>
      ),
      capacity: (
        <ArgonTypography variant="caption" color="text" fontWeight="medium">
          150 rooms
        </ArgonTypography>
      ),
      "license status": <LicenseStatus status="renewed" />,
      action,
      map: (
        <IconButton onClick={() => window.open(`https://www.google.com/maps?q=9.8965,8.8583`, '_blank')}>
          <MapIcon />
        </IconButton>
      ),
    },
    {
      hotel: [
        <ArgonBox display="flex" alignItems="center" key="CP">
          <ArgonTypography variant="button" fontWeight="bold">
            CP
          </ArgonTypography>
          <IconButton onClick={() => handleMapClick("Crest Point Hotel")} size="small">
            <MapIcon fontSize="small" />
          </IconButton>
        </ArgonBox>,
        "Crest Point Hotel"
      ],
      location: (
        <ArgonTypography variant="button" color="text" fontWeight="medium">
          Jos, Plateau State
        </ArgonTypography>
      ),
      capacity: (
        <ArgonTypography variant="caption" color="text" fontWeight="medium">
          100 rooms
        </ArgonTypography>
      ),
      "license status": <LicenseStatus status="expired" />,
      action,
      map: (
        <IconButton onClick={() => window.open(`https://www.google.com/maps?q=9.9167,8.8833`, '_blank')}>
          <MapIcon />
        </IconButton>
      ),
    },
    {
      hotel: [
        <ArgonBox display="flex" alignItems="center" key="LV">
          <ArgonTypography variant="button" fontWeight="bold">
            LV
          </ArgonTypography>
          <IconButton onClick={() => handleMapClick("Lamingo Valley Hotel")} size="small">
            <MapIcon fontSize="small" />
          </IconButton>
        </ArgonBox>,
        "Lamingo Valley Hotel"
      ],
      location: (
        <ArgonTypography variant="button" color="text" fontWeight="medium">
          Jos, Plateau State
        </ArgonTypography>
      ),
      capacity: (
        <ArgonTypography variant="caption" color="text" fontWeight="medium">
          80 rooms
        </ArgonTypography>
      ),
      "license status": <LicenseStatus status="renewed" />,
      action,
      map: (
        <IconButton onClick={() => window.open(`https://www.google.com/maps?q=9.9000,8.8667`, '_blank')}>
          <MapIcon />
        </IconButton>
      ),
    },
    {
      hotel: [
        <ArgonBox display="flex" alignItems="center" key="RH">
          <ArgonTypography variant="button" fontWeight="bold">
            RH
          </ArgonTypography>
          <IconButton onClick={() => handleMapClick("Rayfield Resort Hotel")} size="small">
            <MapIcon fontSize="small" />
          </IconButton>
        </ArgonBox>,
        "Rayfield Resort Hotel"
      ],
      location: (
        <ArgonTypography variant="button" color="text" fontWeight="medium">
          Jos, Plateau State
        </ArgonTypography>
      ),
      capacity: (
        <ArgonTypography variant="caption" color="text" fontWeight="medium">
          120 rooms
        </ArgonTypography>
      ),
      "license status": <LicenseStatus status="renewed" />,
      action,
      map: (
        <IconButton onClick={() => window.open(`https://www.google.com/maps?q=9.8833,8.8500`, '_blank')}>
          <MapIcon />
        </IconButton>
      ),
    },
    {
      hotel: [
        <ArgonBox display="flex" alignItems="center" key="PH">
          <ArgonTypography variant="button" fontWeight="bold">
            PH
          </ArgonTypography>
          <IconButton onClick={() => handleMapClick("Plateau Hotel")} size="small">
            <MapIcon fontSize="small" />
          </IconButton>
        </ArgonBox>,
        "Plateau Hotel"
      ],
      location: (
        <ArgonTypography variant="button" color="text" fontWeight="medium">
          Jos, Plateau State
        </ArgonTypography>
      ),
      capacity: (
        <ArgonTypography variant="caption" color="text" fontWeight="medium">
          200 rooms
        </ArgonTypography>
      ),
      "license status": <LicenseStatus status="expired" />,
      action,
      map: (
        <IconButton onClick={() => window.open(`https://www.google.com/maps?q=9.9167,8.9000`, '_blank')}>
          <MapIcon />
        </IconButton>
      ),
    },
  ],
};

export default hotelsTableData;
